type TemplateResponse* = object
  ## Template fields
  id*: string ## Template ID
  adAccountId*: string ## ID of the Ad Account that owns the template
  adAccountIds*: seq[string] ## IDs of the Ad Accounts that have access to this template
  userId*: string ## ID of the user who created the template
  name*: string ## Template Name
  reportStartRelativeDaysInPast*: float ## The number of days prior to the day the report will be delivered at which the report will start
  reportEndRelativeDaysInPast*: float ## The number of days prior to the day the report will be delivered at which the report will end
  dateRange*: TemplateResponse_date_range
  reportLevel*: MetricsReportingLevel
  reportFormat*: DataOutputFormat
  columns*: Columns ## A list of columns to be included in the report
  granularity*: Granularity
  viewWindowDays*: float ## The length of the sliding window over which view conversions will be attributed
  clickWindowDays*: float ## The length of the sliding window over which click conversions will be attributed
  engagementWindowDays*: float ## The length of the sliding window over which engagement conversions will be attributed
  conversionReportTimeType*: ConversionReportTimeType ## Conversion report time type
  filtersJson*: string ## A JSON representation of any filters to be applied before returning report data. Each filter object should contain all of the following fields:<br> \"field\": The column name<br> \"operator\": The operator. Allowed operators: [\"=\", \"!=\", \"in\", \"not_in\", \"~\", \">\", \"<\", \"contains_substring\"]<br> \"value\": A single value or a list of values
  isOwnedByUser*: bool ## A boolean value that indicates if the user owns the template
  isScheduled*: bool ## A boolean value that indicates if this template has been used to create a scheduled report
  creationSource*: CreationSource ## The surface used to create this template
  isDeleted*: bool ## A boolean that indicates if the template has been deleted
  updatedTime*: float ## Time of last update in seconds since Unix epoch
  customColumnIds*: seq[string] ## A list of custom column IDs
  `type`*: `Type` ## Reporting template type
  ingestionSources*: IngestionSources ## The filter on the conversion ingestion source method for conversion metrics

